import React from 'react'
import h_bg from "../../assets/h_bg.jpg"

const Header = () => {
  return (
    <div className='header_container'>
        <h2>Find A Best Place to Live as Student</h2>
        <img src={h_bg} class="img-fluid" alt="..."></img>
      
    </div>
  )
}

export default Header
